import {Component, Inject, OnInit, PLATFORM_ID} from '@angular/core';
import {isPlatformBrowser} from '@angular/common';
import 'rxjs/add/observable/interval';

@Component({
  selector: 'blackgeeks-recaptcha',
  templateUrl: './recaptcha.component.html',
  styleUrls: ['./recaptcha.component.css']
})
export class RecaptchaComponent implements OnInit {

  public recaptchaString = '';
  public enterText = '';
  private imagesList = [
    'url(\'data:image/png;base64,\')',
    'url(\'data:image/png;base64,\')',
    'url(\'data:image/png;base64,\')',
    'url(\'data:image/png;base64,\')'
  ];

  constructor(@Inject(PLATFORM_ID) public platformId: Object) {
  }

  ngOnInit() {

    if (isPlatformBrowser(this.platformId)) {
      this.reset();
      // Observable.interval(5000).subscribe(() => {
      //   this.reset();
      // });
    }
  }


  private makeid() {
    let text = '';
    const possible = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';

    for (let i = 0; i < 5; i++) {
      text += possible.charAt(Math.floor(Math.random() * possible.length));
    }
    return text;
  }

  public reset() {
    this.recaptchaString = this.makeid();
    this.enterText = '';
    document.getElementById('text-wrapper').style.backgroundImage = this.imagesList[Math.floor(Math.random() * this.imagesList.length)];
    return this.recaptchaString;
  }

  public getResponse() {
    if (this.recaptchaString === this.enterText) {
      this.reset();
      return true;
    } else {
      this.reset();
      return false;
    }
  }
}
